void doGet(BitSet a, OpenBitSet b) {
  int max = a.size();
  for (int i=0; i<max; i++) {
    if (a.get(i) != b.get(i)) {
      fail("mismatch: BitSet=["+i+"]="+a.get(i));
    }
  }
}

